import React from 'react'
import "./Main.css"

const bugObj = [
    {
        id: 1,
        description: "hello",
        status: 0
    },
    {
        id: 2,
        description: "hello",
        status: 1
    },
    {
        id: 3,
        description: "hello",
        status: 1
    },
    {
        id: 6,
        description: "hello",
        status: 2
    }
]

const Main = () => {
  return (
    <div className='main-wrapper'>
        <div className='main-center'>
            <div className='bug-info-title-wrapper'><div>Id</div><div>Description</div><div>Status</div></div>
            <div className='bug-info-wrapper'>
                {bugObj.map((bug) => (
                    <div className='bug-info'>
                        <div>{bug.id}</div>
                        <div>{bug.description}</div>
                        <div>{bug.status}</div>
                    </div>    
                ))}
            </div>
        </div>
        <div className='addbug-wrapper'>
            <span></span><button>Add bug</button>
        </div>
    </div>
  )
}

export default Main
